function $(sel) {
  return document.querySelector(sel);
}

function switch_mode() {
  if(saito) {
    $("#non-saito").classList.add("h");
    $("#saito").classList.remove("n");
    setTimeout(function() {
      $("#non-saito").classList.add("n");
      $("#saito").classList.remove("h");
    }, 300);
    setTimeout(function() {
      if( s_step == 1 ) {
        $("#s_01").classList.remove("h");
        $("#saito_cloud").setAttribute("clip-path", "url(#cloud_clp" + s_step + ")");
      }
    }, 600);
    setTimeout(function() {
      if( s_step == 1 ) {
        $("#s_01_dots").classList.remove("h");
      }
    }, 900);
  } else {
    $("#saito").classList.add("h");
    $("#non-saito").classList.remove("n");
    setTimeout(function() {
      $("#saito").classList.add("n");
      $("#non-saito").classList.remove("h");
    }, 300);
  }
}

function add_cl(name, arr, class_arr) {
  for(let i = 0; i < arr.length; i++) {
    $("#" + name + arr[i]).classList.add(class_arr);
  }
}

function remove_cl(name, arr, class_arr) {
  for(let i = 0; i < arr.length; i++) {
    $("#" + name + arr[i]).classList.remove(class_arr);
  }
}

$("#switch-body").addEventListener("click", function() {
  cancelAnimationFrame(animID);
  $("#switch").classList.toggle("saito");
  saito ? saito = false : saito = true;
  switch_mode();
}, false);

